import Home from './Pages/Home'
import Nav from './Components/Nav';
import './App.css';
import { Routes, Route } from 'react-router-dom';
function App() {
  return (
    <div>
      <Routes>
      <Route path="/" element={<Home/>} />
      <Nav/>
      </Routes>

    </div>
  );
}

export default App;
